CREATE DATABASE IF NOT EXISTS nubium_db;
USE nubium_db;

START TRANSACTION;

CREATE TABLE IF NOT EXISTS `user`
(
    `id`            INT UNSIGNED NOT NULL AUTO_INCREMENT,
    `login`         VARCHAR(30)  NOT NULL,
    `first_name`    VARCHAR(15)  NOT NULL,
    `last_name`     VARCHAR(15)  NOT NULL,
    `password`      VARCHAR(255) NOT NULL,
    `is_active`     TINYINT      NOT NULL DEFAULT 1,
    `registered_at` DATETIME     NOT NULL DEFAULT CURRENT_TIMESTAMP,
    PRIMARY KEY (`id`),
    UNIQUE INDEX `id_UNIQUE` (`id` ASC) VISIBLE,
    UNIQUE INDEX `login_UNIQUE` (`login` ASC) VISIBLE
)
    ENGINE = InnoDB
    CHARACTER SET utf8mb4;


CREATE TABLE IF NOT EXISTS `article`
(
    `id`         INT UNSIGNED                           NOT NULL AUTO_INCREMENT,
    `user_id`    INT UNSIGNED                           NOT NULL,
    `link`       VARCHAR(255)                           NOT NULL,
    `title`      VARCHAR(100)                           NOT NULL,
    `excerpt`    VARCHAR(255)                           NOT NULL,
    `content`    TEXT                                   NOT NULL,
    `status`     ENUM ('private', 'public', 'archived') NOT NULL DEFAULT 'private',
    `created_at` DATETIME                               NOT NULL DEFAULT CURRENT_TIMESTAMP,
    `changed_at` DATETIME                               NULL     DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
    PRIMARY KEY (`id`),
    UNIQUE INDEX `id_UNIQUE` (`id` ASC),
    UNIQUE INDEX `title_UNIQUE` (`title` ASC),
    UNIQUE INDEX `link_UNIQUE` (`link` ASC),
    INDEX `fk_article_user_idx` (`user_id` ASC),
    CONSTRAINT `fk_article_user`
        FOREIGN KEY (`user_id`)
            REFERENCES `user` (`id`)
)
    ENGINE = InnoDB
    CHARACTER SET utf8mb4;

CREATE TABLE IF NOT EXISTS `article_rating`
(
    `article_id`  INT UNSIGNED NOT NULL,
    `user_id`     INT UNSIGNED NOT NULL,
    `value`       TINYINT      NOT NULL,
    `inserted_at` DATETIME     NOT NULL DEFAULT CURRENT_TIMESTAMP,
    INDEX `fk_article_rating_article1_idx` (`article_id` ASC),
    INDEX `fk_article_rating_user1_idx` (`user_id` ASC),
    PRIMARY KEY (`article_id`, `user_id`),
    CONSTRAINT `fk_article_rating_article1`
        FOREIGN KEY (`article_id`)
            REFERENCES `article` (`id`),
    CONSTRAINT `fk_article_rating_user1`
        FOREIGN KEY (`user_id`)
            REFERENCES `user` (`id`)
)
    ENGINE = InnoDB
    CHARACTER SET utf8mb4;

